INSERT INTO `r_category_description` (`id_category`, `id_language`, `name`, `meta_title`, `meta_keyword`, `meta_description`, `description`) VALUES
(1, 1, 'Electronics', 'Electronics', 'Electronics', 'Electronics', '<p>&lt;p&gt;The photographic camera is a light-tight chamber with either a lens or pinhole that permits an external image to be projected onto a surface holding a light-sensitive material. The length of time light is allowed to fall onto the sensitized surface is controlled with a shutter, and for lensed cameras, some form of variable aperture is provided to control light intensity.&lt;/p&gt;</p>\r\n'),
(2, 1, 'Digital camera', 'digital camera', 'digital camera', 'digital camera', '<p>&lt;p&gt;A digital camera (or digicam) is a camera that takes video or still photographs by recording images on an electronic image sensor. Most cameras sold today are digital,[1] and digital cameras are incorporated into many devices ranging from PDAs and mobile phones (called camera phones) to vehicles.&lt;/p&gt;</p>\r\n'),
(3, 1, 'Handy cam', 'handy cam', 'handy cam', 'handy cam', '<p>&lt;p&gt;Watching your favourite memories on a big screen is no longer limited to your room. Now you can shoot, project and share your videos with your loved ones anytime at any place.&lt;/p&gt;</p>\r\n'),
(6, 1, 'Laptops', 'Laptops', 'Laptops', 'Laptops', '<p>&lt;p&gt;&lt;em style=&quot;font-weight: bold; font-style: normal; color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: small; font-variant: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);&quot;&gt;Awesome laptop collections!!&lt;/em&gt;&lt;/p&gt;</p>\r\n'),
(7, 1, 'Accessories', 'accessories', 'accessories', 'accessories', '<p>&lt;p&gt;The television is a telecommunication system for broadcasting and receiving moving pictures and sound over a distance. The term has come to refer to all the aspects of television programming and transmission as well.&lt;/p&gt;</p>\r\n'),
(8, 1, 'Clothing', 'Mens Clothing', 'Clothing', 'Clothing', '<p>Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.Men clothing,shoe and related accessories can found here.</p>\r\n'),
(11, 1, 'Men', '0', 'Men', 'Men', '<p>&lt;p&gt;Men clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(37, 1, 'Shoes', '0', 'Shoes', 'Shoes', '<p>&lt;p&gt;Men clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(44, 1, 'Women', 'women', 'Women', 'Women', '<p>&lt;p&gt;Women clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(46, 1, 'Shoes', 'women shoes', 'shoes', 'shoes', '<p>&lt;p&gt;Women clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(47, 1, 'Clothing', '0', 'clothing', 'clothing', '<p>&lt;p&gt;Women clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(48, 1, 'Books', '0', 'books', 'books', '&lt;p&gt;Here you can get lot many collections of different books!!&lt;/p&gt;'),
(49, 1, 'Jewelry', 'title', 'Jewelry', 'Jewelrys', '<p>&lt;p&gt;Women clothing,shoe and related accessories can found here.&lt;/p&gt;</p>\r\n'),
(50, 1, 'Mobiles', 'Find latest Smart Phones Mobile Phones Price list in India updated on 2014 July 03rd compiled from leading online shops. Choose and Get best deals from wide range of Smart Phones Mobile Phones', 'Find latest Smart Phones Mobile Phones Price list in India updated on 2014 July 03rd compiled from leading online shops. Choose and Get best deals from wide range of Smart Phones Mobile Phones', 'Find latest Smart Phones Mobile Phones Price list in India updated on 2014 July 03rd compiled from leading online shops. Choose and Get best deals from wide range of Smart Phones Mobile Phones', '<p>HTC One M8 Review:</p>\r\n\r\n<ul>\r\n	<li><span style="color:rgb(0, 128, 0)"><strong>Reasons to buy HTC One M8:</strong></span>\r\n\r\n	<ul>\r\n		<li>Android OS v4.4.2 Kitkat | 2.5GHz Quad-core Krait 400 Processor | Qualcomm Snapdragon 801 Chipset | Dual 4 MP Ultra Pixel rear camera | 5 MP front camera | 5 inches Super LCD 3 Screen | Full HD Display |&nbsp; MicroSD card Slot upto 128GB | NFC | HTC Sense UI v6 with updated Blink Feed | 3G | 4G | NFC | Corning Gorilla Glass 3 Protection for the screen</li>\r\n	</ul>\r\n	</li>\r\n	<li><span style="color:rgb(255, 0, 0)"><strong>What goes against HTC One M8:</strong></span>\r\n	<ul>\r\n		<li>Battery not up to the mark | Lacks 2K video recording | Non-removable battery</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Design:</strong>&nbsp;HTC One M8 dazzles us with impressive features that could just heat up the competition. With perfectly tailored design, this phone definitely is the one to lay our hands on. HTC One M8 has a bezel design and is made with similar aluminium metal body like the HTC One which maintains a luxury feel. The Dual front speakers are on the top and bottom on the front side. The speakers powered by HTC Boom is good enough to fill a crowded room with good quality loud music. On the front&nbsp; side on the right top corner lies the front camera along with the proximity sensor. HTC One M8 gets on screen capacitive buttons which is first on a HTC device. On the back of the phone is the impressive dual 4 MP camera along with LED Flash and HTC branding in the middle. On the left side lies the microSD lot and on the right are the volume rockers. Sadly HTC One M8 has a non-removable battery. The phone is completely sealed but it is not waterproof like the Sony Xperia devices. The device is 9.2 mm thick whereas Sony Xperia Z2 only 8.2 mm thick. The actual dimensions are 146.4 x 70.6 x 9.4 mm and it weighs 160 g. HTC One M8 comes in Gunmetal Gray, Glacial Silver and Amber Gold colours.</li>\r\n	<li><strong>Display:</strong>&nbsp;HTC One M8 has a 5 inches Super LCD 3 screen with Full HD resolution of 1920x 1080 pixels. The pixel density is around ~441 ppi which makes the screen a pleasant one to watch. The screen is protected with Corning Gorilla Glass 3. User interface is looking much better with the new HTC Sense v6 along with Blink Feed and HTC Zoe. Perhaps inspired by LG&rsquo;s Knock on feature, HTC One M8 also features a motion launch feature which wakes the screen by just giving a double tap on the screen.</li>\r\n	<li><strong>Hardware &amp; OS:</strong>&nbsp;HTC One M8 is the best yet phone from HTC in terms of features. It competes directly with Sony Xperia Z2. The hardware and software have improved from the HTC One but still the phone lacks some of the competitive features like 2K video recording. Under the hood lies the Qualcomm MSM8974AB Snapdragon 801 from Qualcomm and the processor is a Quad-core one with 2.5GHz clock speed. There is also 2GB RAM available which can manage apps with ease. With this kind of a hardware, the phone should be blazing fast. The GPU is managed with Adreno 330 which can provide better gaming experience on the phone. The Operating System is Android OS v4.4.2 Kitkat out of the box.</li>\r\n	<li><strong>Camera, Music and Multimedia:</strong>&nbsp;HTC has raised the bar by just adding Dual 4 MP camera&rsquo;s on the back along with Dual LED Flash and uses HTC&rsquo;s Ultra Pixel technology. The primary lens on the back does all the image capturing and the secondary lens on the top adds more depth to images captured. The rear camera has BSI Sensor with pixel size 2.0 um, the sensor size is ? inches, f2.0 and 28 mm lens. The primary rear camera can record 1080p@30fps Full HD videos. Using the Dual camera we can refocus on a photo captured and the secondary lens sensors collect optical data and also senses the depth in images captured. The phone also has a 5 MP front camera which also can record Full HD videos.</li>\r\n	<li><strong>Storage:</strong>&nbsp;HTC One M8 comes in 16GB and 32GB internal storage variants. To our surprise&nbsp; HTC One M8 packs 128GB microSD slot which is more than enough&nbsp; to carry our entertainment storage.</li>\r\n	<li><strong>Battery and Talk time:</strong>&nbsp;HTC One M8 disappoints on the battery part by having a non-removable Li-ion 2600 mAh battery (expectations were for a 3000 mAh) which delivers an average talk time of up to 14 hours (2G) / up to 20 hours (3G) and standby time up to 271 hours (2G) / up to 496 hours (3G).</li>\r\n	<li><strong>Connectivity:</strong>&nbsp;HTC One M8 is a single SIM device which supports 2G, 3G and 4G. The SIM card slot type is Nano SIM like most other high-end phones. The 2G connectivity support is via Quad band (GSM 850 / 900 / 1800 / 1900), 3G via Quad band (HSDPA 850 / 900 / 1900 / 2100) and 4G via Penta Band (LTE 700 / 900 / 1800 / 2100 / 2600). 3G Data Transfer Speeds up to HSDPA 42 Mbps and HSUPA 5.76 Mbps and 4G speeds upto LTE, Cat4, 50 Mbps UL, 150 Mbps DL are available. The phone also comes with NFC option. Other options like Bluetooth v4.0 with A2DP, LE, EDR, Wi-Fi 802.11 a/b/g/n/ac, dual-band DLNA Wi-Fi hotspot and microUSB v2.0 are also available.</li>\r\n</ul>\r\n'),
(50, 2, 'Mobiles', 'HTC One M8 Price in India Jul 03 2014 | Specs &amp; Reviews', 'Best HTC One M8 Price is Rs.43348/- as compared from 5 Online Shops in India. Price valid all over India including Mumbai, Delhi, Chennai, Hyderabad, Bangalore, Kolkata and other cities. Specs: 5 inch Screen, Android 4.4.2 OS, 2.5 GHz Quad Core Processor, 2GB RAM, 4MP Camera', 'Price of HTC One M8 in India is Rs.43348/- on 2014 July 03rd compared from leading Online Shops.', '<p>HTC One M8 Review:</p>\r\n\r\n<ul>\r\n	<li><span style="color:rgb(0, 128, 0)"><strong>Reasons to buy HTC One M8:</strong></span>\r\n\r\n	<ul>\r\n		<li>Android OS v4.4.2 Kitkat | 2.5GHz Quad-core Krait 400 Processor | Qualcomm Snapdragon 801 Chipset | Dual 4 MP Ultra Pixel rear camera | 5 MP front camera | 5 inches Super LCD 3 Screen | Full HD Display |&nbsp; MicroSD card Slot upto 128GB | NFC | HTC Sense UI v6 with updated Blink Feed | 3G | 4G | NFC | Corning Gorilla Glass 3 Protection for the screen</li>\r\n	</ul>\r\n	</li>\r\n	<li><span style="color:rgb(255, 0, 0)"><strong>What goes against HTC One M8:</strong></span>\r\n	<ul>\r\n		<li>Battery not up to the mark | Lacks 2K video recording | Non-removable battery</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>Design:</strong>&nbsp;HTC One M8 dazzles us with impressive features that could just heat up the competition. With perfectly tailored design, this phone definitely is the one to lay our hands on. HTC One M8 has a bezel design and is made with similar aluminium metal body like the HTC One which maintains a luxury feel. The Dual front speakers are on the top and bottom on the front side. The speakers powered by HTC Boom is good enough to fill a crowded room with good quality loud music. On the front&nbsp; side on the right top corner lies the front camera along with the proximity sensor. HTC One M8 gets on screen capacitive buttons which is first on a HTC device. On the back of the phone is the impressive dual 4 MP camera along with LED Flash and HTC branding in