INSERT INTO `r_email_template_description` (`id_email_template`, `id_language`, `title`, `subject`, `description`) VALUES
(1, 1, 'Customer Order Mail', '%store_name%- Thank you for registering', '<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.01//EN" "http://www.w3.org/TR/1999/REC-html401-19991224/strict.dtd">\r\n<html>\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8">\r\n<title><?php\r\necho $title;\r\n?></title>\r\n\r\n</head>\r\n<body>\r\n<div id="" style="width: 680px; color: #000000;	font-family: Arial, Helvetica, sans-serif; font-size: 12px;line-height:13px;">\r\n<a href="<?php echo $store_url; ?>" title="<?php echo $store_name; ?> "><img src="<?php echo $logo;?>" alt="<?php echo $store_name; ?>" id="" style="margin-bottom: 0px;text-align:center;"/></a>\r\n  <p><?php\r\necho "Thank you for your interest in our products. Your order has been received and will be processed once payment has been confirmed";\r\n?></p>\r\n  <?php\r\nif ($customer_id) {\r\n?>\r\n  <p><?php\r\n    echo "To view your order <a href=''".$link."'' target=''_blank'' style=''color: #378DC1;	text-decoration: underline;	cursor: pointer;''>click here</a>";\r\n?></p>\r\n  <?php\r\n}\r\n?>\r\n  <?php\r\nif ($download) {\r\n?>\r\n  <p><?php\r\n    echo "Once your payment has been confirmed you can click on the link below to access your downloadable products:";\r\n?></p>\r\n  <p><a href="<?php\r\n    echo $download;\r\n?>" style="color: #378DC1;	text-decoration: underline;	cursor: pointer;"><?php\r\n    echo $download;\r\n?></a></p>\r\n  <?php\r\n}\r\n?>\r\n <table style="border-collapse: collapse;	width: 100%;	border-top: 1px solid #DDDDDD;	border-left: 1px solid #DDDDDD;	margin-bottom: 15px; border-bottom: 1px solid #DDDDDD; border-right: 1px solid #DDDDDD;">\r\n    <thead>\r\n      <tr>\r\n        <td class="" style=" background-color: #EFEFEF;	padding: 0px 5px; border-right: 1px solid #DDDDDD; font-weight:bold;padding:7px;"><?php echo ''Product'';?></td>\r\n        <td class="" style=" background-color: #EFEFEF;	padding: 0px 5px; border-right: 1px solid #DDDDDD; font-weight:bold;padding:7px;"><?php echo ''Model''; ?></td>\r\n        <td class="" style=" background-color: #EFEFEF;	padding: 0px 5px; border-right: 1px solid #DDDDDD; font-weight:bold;padding:7px;"><?php echo ''Quantity''; ?></td>\r\n        <td class="" style=" background-color: #EFEFEF;	padding: 0px 5px; border-right: 1px solid #DDDDDD; font-weight:bold;padding:7px;"><?php echo ''Price''; ?></td>\r\n   		<td class="" style=" background-color: #EFEFEF;	padding: 0px 5px; border-right: 1px solid #DDDDDD; font-weight:bold;padding:7px;"><?php echo ''Total''; ?></td>\r\n      </tr>\r\n    </thead>\r\n    <tbody>\r\n      <?php\r\nforeach ($products as $product) {\r\n?>\r\n      <tr>\r\n        <td class="" style="border-right: 1px solid #DDDDDD;	border-bottom: 1px solid #DDDDDD;text-align: left;	padding: 7px;"><?php\r\n    echo $product[''name''];\r\n?>\r\n          <?php\r\n    foreach ($product[''option''] as $option) {\r\n?>\r\n          <br />\r\n          <small> - <?php\r\n        echo $option[''name''];\r\n?>: <?php\r\n        echo $option[''value''];\r\n?></small>\r\n          <?php\r\n    }\r\n?></td>\r\n        <td class="" style="border-right: 1px solid #DDDDDD;	border-bottom: 1px solid #DDDDDD; text-align: left;	padding: 7px;"><?php\r\n    echo $product[''model''];\r\n?></td>\r\n        <td class="" style="border-right: 1px solid #DDDDDD;	border-bottom: 1px solid #DDDDDD; text-align: right;padding: 7px;" ><?php\r\n    echo $product[''quantity''];\r\n?></td>\r\n        <td class="" style="border-right: 1px solid #DDDDDD;	border-bottom: 1px solid #DDDDDD; text-align: right;padding: 7px;" ><?php\r\n    echo $product[''price''];\r\n?></td>\r\n        <td class="" style="border-right: 1px solid #DDDDDD;	border-bottom: 1px solid #DDDDDD; text-align: right;padding: 7px;" ><?php\r\n    echo $product[''total''];\r\n?></td>\r\n      </tr>\r\n      <?php\r\n}\r\n?>\r\n    </tbody>\r\n    <tfoot  style="border-bottom:1px solid #ddd; ">\r\n      <?php\r\nforeach ($totals as $total) {\r\n?>\r\n      <tr>\r\n        <td colspan="4" class="" style="text-align: right;	padding: 7px; border-bottom:1px solid #ddd;border-right:1px solid #ddd;"><b><?php\r\n    echo $_SESSION[''TObj'']->_($total[''title'']);\r\n?></b></td>\r\n        <td class="" style="text-align: right; padding: 7px;border-bottom:1px solid #ddd;border-right:1px solid #ddd;"><?php\r\n    echo $total[''text''];\r\n?></td>\r\n      </tr>\r\n      <?php\r\n}\r\n?>\r\n    </tfoot>\r\n  </table>\r\n  <table class="" style="border-collapse: collapse;	width: 100%; margin-bottom: 15px;  border:1px solid #DDDDDD;">\r\n    <thead>\r\n      <tr>\r\n        <td class="" colspan="2" style="text-align: left;	padding: 7px; background-color: #EFEFEF; border:1px solid #DDDDDD; font-weight:bold;"><?php\r\necho ''Order Details'';\r\n?></td>\r\n      </tr>\r\n    </thead>\r\n    <tbody>\r\n      <tr>\r\n        <td class="" style="text-align: left; padding: 7px; border-right:1px solid #DDDDDD;font-weight:bold; "><?php if ($invoice_no) { ?>\r\n          <b><?php\r\n    echo ''Invoice No.:''; ?></b> <?php\r\n    echo $invoice_no;\r\n?><br />\r\n          <?php\r\n}\r\n?>\r\n          <b><?php\r\necho ''Order No:'';\r\n?></b> <?php\r\necho $order_id;\r\n?><br />\r\n          <b><?php\r\necho ''Order Placed On:'';\r\n?></b> <?php\r\necho $date_added;\r\n?><br />\r\n          <b><?php\r\necho ''Payment Method:'';\r\n?></b> <?php\r\necho $payment_method;\r\n?></td>\r\n        <td class="left" style="text-align: left;	padding: 7px; "><b><?php\r\necho ''Email:'';\r\n?></b> <?php\r\necho $email;\r\n?><br />\r\n          <b><?php\r\necho ''Telephone:'';\r\n?></b> <?php\r\necho $telephone;\r\n?><br />\r\n          <?php\r\nif ($shipping_method) {\r\n?>\r\n          <b><?php\r\n    echo ''Shipping Method:'';\r\n?></b> <?php\r\n    echo $shipping_method;\r\n?>\r\n          <?php\r\n}\r\n?>\r\n        </td>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n  <table class="" style="border-collapse: collapse;	width: 100%;	border-top: 1px solid #DDDDDD;	border-left: 1px solid #DDDDDD;	margin-bottom: 10px;">\r\n    <thead>\r\n      <tr>\r\n        <td class="left" style="text-align: left;	padding: 7px; border-right:1px solid #DDDDDD;background:#efefef; border:1px solid #ddd; font-weight:bold;"><?php echo ''Payment Address''; ?></td>\r\n        <?php if ($shipping_address) {\r\n?>\r\n        <td class="left" style="text-align: left; padding: 7px; background:#efefef;border:1px solid #ddd; font-weight:bold;"><?php    echo ''Shipping Address''; ?></td>\r\n        <?php\r\n}\r\n?>\r\n      </tr>\r\n    </thead>\r\n    <tbody>\r\n      <tr>\r\n        <td class="" style="text-align: left;	padding: 7px; border-right:1px solid #ddd; border-bottom:1px solid #ddd; font-weight:bold;"><?php echo $payment_address; ?></td>\r\n        <?php if ($shipping_address) { ?>        \r\n        <td class="" style="text-align: left;	padding: 7px; border-right:1px solid #ddd; border-bottom:1px solid #ddd; "><?php   echo $shipping_address; ?></td>\r\n        <?php\r\n}\r\n?>\r\n      </tr>\r\n    </tbody>\r\n  </table>\r\n  <table align="left" width="100%"  style="margin-bottom:15px;">\r\n  <tr>\r\n  	<td align="left" style="float:left;"><p><?php\r\necho ''Please reply to this email if you have any questions.'';\r\n?></p></td>\r\n<td align="right" style=" float:right; text-align:right;"><p><?php\r\necho ''Powered By <a href="http://www.sporanzo.com" target="_blank" style="color: #378DC1;\r\n	text-decoration: underline;\r\n	cursor: pointer" >Sporanzo</a>.'';\r\n?></p></td>\r\n</tr>\r\n  </table>\r\n</div>\r\n</body>\r\n</html>'),
(1, 2, 'Customer Order Mail', 'Awaiting cheque payment', '<table class="table">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style="font-size:28px">Hi {firstname} {lastname},</span><br />\r\n			<span style="font-size:16px">Thank you for shopping with {shop_name}!</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#f8f8f8">\r\n			<table class="table" style="width:100%">\r\n				<tbody>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n						<td>\r\n						<p>Order {order_name}&nbsp;-&nbsp;Awaiting check payment</p>\r\n						<span style="color:#777">Your order with the reference <span style="color:#333"><strong>{order_name}</strong></span> has been placed successfully and will be <strong>shipped as soon as we receive your payment</strong>. </span></td>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="background-color:#f8f8f8">\r\n			<table class="table" style="width:100%">\r\n				<tbody>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n						<td>\r\n						<p>You have selected to pay by check.</p>\r\n						<span style="color:#777">Here are the bank details for your check:<br />\r\n						<span style="color:#333"><strong>Amount:</strong></span> {total_paid}<br />\r\n						<span style="color:#333"><strong>Payable to the order of:</strong></span> {cheque_name}<br />\r\n						<span style="color:#333"><strong>Please mail your check to:</strong></span> {cheque_address_html} </span></td>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>You can review your order and download your invoice from the <a href="http://localhost/prestashop/mails/en/%7Bhistory_url%7D" style="color:#337ff1">&quot;Order history&quot;</a> section of your customer account by clicking <a href="http://localhost/prestashop/mails/en/%7Bmy_account_url%7D" style="color:#337ff1">&quot;My account&quot;</a> on our shop.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>If you have a guest account, you can follow your order via the <a href="http://localhost/prestashop/mails/en/%7Bguest_tracking_url%7D" style="color:#337ff1">&quot;Guest Tracking&quot;</a> section on our shop.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n'),
(2, 1, 'Customer Registraion Welcome Mail (General)', 'Welcome to %store_name%!!', '<p>Dear Customer,</p>\r\n\r\n<p>Thanks for registering in <a href="%store_url%" target="_blank">%store_name%</a> . Your account has now been created and you can log in by using your email address and password @ <a href="%store_customer_login_url%" target="_blank">%store_name%</a></p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n'),
(2, 2, 'Customer Registraion Welcome Mail (General)', 'Awaiting cheque payment', '<table class="table table-mail" style="-moz-box-shadow:0 0 5px #afafaf; -o-box-shadow:0 0 5px #afafaf; -webkit-box-shadow:0 0 5px #afafaf; box-shadow:0 0 5px #afafaf; filter:progid:DXImageTransform.Microsoft.Shadow(color=#afafaf,Direction=134,Strength=5); margin-top:10px; width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:20px">&nbsp;</td>\r\n			<td>\r\n			<table class="table" style="width:100%">\r\n				<tbody>\r\n					<tr>\r\n						<td><a href="http://localhost/prestashop/mails/en/%7Bshop_url%7D" style="color:#337ff1" title="{shop_name}"><img alt="{shop_name}" src="http://localhost/prestashop/mails/en/%7Bshop_logo%7D" /> </a></td>\r\n					</tr>\r\n					<tr>\r\n						<td><span style="font-size:28px">Hi {firstname} {lastname},</span><br />\r\n						<span style="font-size:16px">Thank you for shopping with {shop_name}!</span></td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="background-color:#f8f8f8">\r\n						<table class="table" style="width:100%">\r\n							<tbody>\r\n								<tr>\r\n									<td>&nbsp;</td>\r\n									<td>\r\n									<p>Order {order_name}&nbsp;-&nbsp;Awaiting check payment</p>\r\n									<span style="color:#777">Your order with the reference <span style="color:#333"><strong>{order_name}</strong></span> has been placed successfully and will be <strong>shipped as soon as we receive your payment</strong>. </span></td>\r\n									<td>&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td style="background-color:#f8f8f8">\r\n						<table class="table" style="width:100%">\r\n							<tbody>\r\n								<tr>\r\n									<td>&nbsp;</td>\r\n									<td>\r\n									<p>You have selected to pay by check.</p>\r\n									<span style="color:#777">Here are the bank details for your check:<br />\r\n									<span style="color:#333"><strong>Amount:</strong></span> {total_paid}<br />\r\n									<span style="color:#333"><strong>Payable to the order of:</strong></span> {cheque_name}<br />\r\n									<span style="color:#333"><strong>Please mail your check to:</strong></span> {cheque_address_html} </span></td>\r\n									<td>&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td>You can review your order and download your invoice from the <a href="http://localhost/prestashop/mails/en/%7Bhistory_url%7D" style="color:#337ff1">&quot;Order history&quot;</a> section of your customer account by clicking <a href="http://localhost/prestashop/mails/en/%7Bmy_account_url%7D" style="color:#337ff1">&quot;My account&quot;</a> on our shop.</td>\r\n					</tr>\r\n					<tr>\r\n						<td>If you have a guest account, you can follow your order via the <a href="http://localhost/prestashop/mails/en/%7Bguest_tracking_url%7D" style="color:#337ff1">&quot;Guest Tracking&quot;</a> section on our shop.</td>\r\n					</tr>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td><a href="http://localhost/prestashop/mails/en/%7Bshop_url%7D" style="color:#337ff1">{shop_name}</a> powered by sporanzo</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td style="width:20px">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n'),
(3, 1, 'Customer Registraion Welcome Mail (Awaiting Approval)', '%store_name% : Awaiting Approval!!', '<p>Dear Customer,</p>\r\n\r\n<p>Your account is pending for verification. Once approved we will send a mail with login details.</p>\r\n\r\n<p>Thanks for visiting.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%</p>\r\n'),
(3, 2, 'Customer Registraion Welcome Mail (Awaiting Approval)', 'Sporanzo Order No:%order_id%', '<p>&lt;!DOCTYPE html PUBLIC &quot;-//W3C//DTD HTML 4.01//EN&quot; &quot;http://www.w3.org/TR/1999/REC-html401-19991224/strict.dtd&quot;&gt;<br />\r\n&lt;html&gt;<br />\r\n&lt;head&gt;<br />\r\n&lt;meta http-equiv=&quot;Content-Type&quot; content=&quot;text/html; charset=utf-8&quot;&gt;<br />\r\n&lt;title&gt;&lt;?php<br />\r\necho $title;<br />\r\n?&gt;&lt;/title&gt;<br />\r\n&lt;style type=&quot;text/css&quot;&gt;<br />\r\nbody {<br />\r\n&nbsp;&nbsp; &nbsp;color: #000000;<br />\r\n&nbsp;&nbsp; &nbsp;font-family: Arial, Helvetica, sans-serif;<br />\r\n}<br />\r\nbody, td, th, input, textarea, select, a {<br />\r\n&nbsp;&nbsp; &nbsp;font-size: 12px;<br />\r\n}<br />\r\np {<br />\r\n&nbsp;&nbsp; &nbsp;margin-top: 0px;<br />\r\n&nbsp;&nbsp; &nbsp;margin-bottom: 20px;<br />\r\n}<br />\r\na, a:visited, a b {<br />\r\n&nbsp;&nbsp; &nbsp;color: #378DC1;<br />\r\n&nbsp;&nbsp; &nbsp;text-decoration: underline;<br />\r\n&nbsp;&nbsp; &nbsp;cursor: pointer;<br />\r\n}<br />\r\na:hover {<br />\r\n&nbsp;&nbsp; &nbsp;text-decoration: none;<br />\r\n}<br />\r\na img {<br />\r\n&nbsp;&nbsp; &nbsp;border: none;<br />\r\n}<br />\r\n#container {<br />\r\n&nbsp;&nbsp; &nbsp;width: 680px;<br />\r\n}<br />\r\n#logo {<br />\r\n&nbsp;&nbsp; &nbsp;margin-bottom: 20px;<br />\r\n}<br />\r\ntable.list {<br />\r\n&nbsp;&nbsp; &nbsp;border-collapse: collapse;<br />\r\n&nbsp;&nbsp; &nbsp;width: 100%;<br />\r\n&nbsp;&nbsp; &nbsp;border-top: 1px solid #DDDDDD;<br />\r\n&nbsp;&nbsp; &nbsp;border-left: 1px solid #DDDDDD;<br />\r\n&nbsp;&nbsp; &nbsp;margin-bottom: 20px;<br />\r\n}<br />\r\ntable.list td {<br />\r\n&nbsp;&nbsp; &nbsp;border-right: 1px solid #DDDDDD;<br />\r\n&nbsp;&nbsp; &nbsp;border-bottom: 1px solid #DDDDDD;<br />\r\n}<br />\r\ntable.list thead td {<br />\r\n&nbsp;&nbsp; &nbsp;background-color: #EFEFEF;<br />\r\n&nbsp;&nbsp; &nbsp;padding: 0px 5px;<br />\r\n}<br />\r\ntable.list thead td a, .list thead td {<br />\r\n&nbsp;&nbsp; &nbsp;text-decoration: none;<br />\r\n&nbsp;&nbsp; &nbsp;color: #222222;<br />\r\n&nbsp;&nbsp; &nbsp;font-weight: bold;<br />\r\n}<br />\r\ntable.list tbody td a {<br />\r\n&nbsp;&nbsp; &nbsp;text-decoration: underline;<br />\r\n}<br />\r\ntable.list tbody td {<br />\r\n&nbsp;&nbsp; &nbsp;vertical-align: top;<br />\r\n&nbsp;&nbsp; &nbsp;padding: 0px 5px;<br />\r\n}<br />\r\ntable.list .left {<br />\r\n&nbsp;&nbsp; &nbsp;text-align: left;<br />\r\n&nbsp;&nbsp; &nbsp;padding: 7px;<br />\r\n}<br />\r\ntable.list .right {<br />\r\n&nbsp;&nbsp; &nbsp;text-align: right;<br />\r\n&nbsp;&nbsp; &nbsp;padding: 7px;<br />\r\n}<br />\r\ntable.list .center {<br />\r\n&nbsp;&nbsp; &nbsp;text-align: center;<br />\r\n&nbsp;&nbsp; &nbsp;padding: 7px;<br />\r\n}<br />\r\n&lt;/style&gt;<br />\r\n&lt;/head&gt;<br />\r\n&lt;body&gt;<br />\r\n&lt;div id=&quot;container&quot;&gt;&lt;a href=&quot;&lt;?php<br />\r\necho $store_url;<br />\r\n?&gt;&quot; title=&quot;&lt;?php<br />\r\necho $store_name;<br />\r\n?&gt;&quot;&gt;&lt;img src=&quot;&lt;?php<br />\r\necho $logo;<br />\r\n?&gt;&quot; alt=&quot;&lt;?php<br />\r\necho $store_name;<br />\r\n?&gt;&quot; id=&quot;logo&quot; /&gt;&lt;/a&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;?php<br />\r\necho &quot;Thank you for your interest in our products. Your order has been received and will be processed once payment has been confirmed&quot;;<br />\r\n?&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;?php<br />\r\nif ($customer_id) {<br />\r\n?&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo &quot;To view your order click on the link below:&quot;;<br />\r\n?&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;a href=&quot;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $link;<br />\r\n?&gt;&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $link;<br />\r\n?&gt;&lt;/a&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp; &lt;?php<br />\r\nif ($download) {<br />\r\n?&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo &quot;Once your payment has been confirmed you can click on the link below to access your downloadable products:&quot;;<br />\r\n?&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;a href=&quot;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $download;<br />\r\n?&gt;&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $download;<br />\r\n?&gt;&lt;/a&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp; &lt;table class=&quot;list&quot;&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot; colspan=&quot;2&quot;&gt;&lt;?php<br />\r\necho &#39;Order Details&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;tbody&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\nif ($invoice_no) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo &#39;Invoice No.:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $invoice_no;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\necho &#39;Order ID:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $order_id;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\necho &#39;Date Added:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $date_added;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\necho &#39;Payment Method:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $payment_method;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\nif ($shipping_method) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo &#39;Shipping Method:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $shipping_method;<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;b&gt;&lt;?php<br />\r\necho &#39;Email:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $email;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\necho &#39;Telephone:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $telephone;<br />\r\n?&gt;&lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;b&gt;&lt;?php<br />\r\necho &#39;IP Address:&#39;;<br />\r\n?&gt;&lt;/b&gt; &lt;?php<br />\r\necho $ip;<br />\r\n?&gt;&lt;br /&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/tbody&gt;<br />\r\n&nbsp; &lt;/table&gt;<br />\r\n&nbsp; &lt;table class=&quot;list&quot;&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\necho &#39;Payment Address&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\nif ($shipping_address) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo &#39;Shipping Address&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;tbody&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\necho $payment_address;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\nif ($shipping_address) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $shipping_address;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/tbody&gt;<br />\r\n&nbsp; &lt;/table&gt;<br />\r\n&nbsp; &lt;table class=&quot;list&quot;&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\necho &#39;Product&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\necho &#39;Model&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\necho &#39;Quantity&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\necho &#39;Price&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\necho &#39;Total&#39;;<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/thead&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;tbody&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\nforeach ($products as $product) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $product[&#39;name&#39;];<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; foreach ($product[&#39;option&#39;] as $option) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;br /&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;small&gt; - &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; echo $option[&#39;name&#39;];<br />\r\n?&gt;: &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; echo $option[&#39;value&#39;];<br />\r\n?&gt;&lt;/small&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; }<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;left&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $product[&#39;model&#39;];<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $product[&#39;quantity&#39;];<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $product[&#39;price&#39;];<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $product[&#39;total&#39;];<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/tbody&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;tfoot&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\nforeach ($totals as $total) {<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td colspan=&quot;4&quot; class=&quot;right&quot;&gt;&lt;b&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $_SESSION[&#39;TObj&#39;]-&gt;_($total[&#39;title&#39;]);<br />\r\n?&gt;&lt;/b&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;td class=&quot;right&quot;&gt;&lt;?php<br />\r\n&nbsp;&nbsp;&nbsp; echo $total[&#39;text&#39;];<br />\r\n?&gt;&lt;/td&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;/tr&gt;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;?php<br />\r\n}<br />\r\n?&gt;<br />\r\n&nbsp;&nbsp;&nbsp; &lt;/tfoot&gt;<br />\r\n&nbsp; &lt;/table&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;?php<br />\r\necho &#39;Please reply to this email if you have any questions.&#39;;<br />\r\n?&gt;&lt;/p&gt;<br />\r\n&nbsp; &lt;p&gt;&lt;?php<br />\r\necho &#39;Powered By &lt;a href=&quot;http://www.sporanzo.com&quot;&gt;Sporanzo&lt;/a&gt;.&#39;;<br />\r\n?&gt;&lt;/p&gt;<br />\r\n&lt;/div&gt;<br />\r\n&lt;/body&gt;<br />\r\n&lt;/html&gt;</p>\r\n'),
(4, 1, 'Customer Registraion Welcome Mail (Successfull Approval)', 'Welcome to %store_name%!!', '<p>Dear Customer,</p>\r\n\r\n<p>Thanks for registering in <a href="%store_url%" target="_blank">%store_name%</a> . Your account has now been created and you can log in by using your email address and password @ <a href="%store_customer_login_url%" target="_blank">%store_name%</a></p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n'),
(4, 2, 'Customer Registraion Welcome Mail (Successfull Approval)', 'Order Update', '<p>Welcome to Sporanzo!!</p>\r\n'),
(6, 1, 'Order Status - Processing', '%store_name% : Order is in Process!!', '<p>Dear Customer,</p>\r\n\r\n<p>Your order is in process.Will be delivered in 2 or 3 days.</p>\r\n\r\n<p>%message%</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%</p>\r\n'),
(6, 2, 'Order Status-Processed', '', ''),
(7, 1, 'Customer Forgot Password Mail', '%store_name%  Forgot password??', '<p>Dear Customer,</p>\r\n\r\n<p>&nbsp;Your Login Details for <a href="%store_url%" target=''_blank'' >%store_name%</a> is:</p>\r\n\r\n<p>&nbsp;Username : %username%</p>\r\n\r\n<p>Password : %password%</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n'),
(7, 2, 'Customer Forgot Password Mail', '%store_name% Admin Login Password!!', '<p>Dear User,</p>\r\n\r\n<p>Your login password is %password%.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n'),
(8, 1, 'Admin Forgot Password Mail', '%store_name% - Forgot password??', '<p>Dear User,</p>\r\n\r\n<p>&nbsp;Your Login Details for <a href="%store_url%" target="_blank">%store_name%</a> is:</p>\r\n\r\n<p>&nbsp;Username : %username%</p>\r\n\r\n<p>Password : %password%</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n'),
(8, 2, 'Admin Forgot Password Mail', '%store_name% - Your Account has been activated!', '<p>Welcome and thank you for registering at %store_name%!. Your account has now been created and you can log in by using your email address and password by visiting our website or at the following URL:<a href="http://www.toysgift.buildoshop.co.uk/public/js/fckeditor/editor/%store_customer_login_url%" target="_blank">click here</a> Upon logging in, you will be able to view your orders,returns and edit your account information.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>%store_name%.</p>\r\n');
