(145, 1, 'Revolution 2020', '', '', '<h3>REVOLUTION 2020 (PAPERBACK) PRICE: RS.89</h3>\r\n\r\n<div class="cls" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 16px; vertical-align: baseline; clear: both; color: rgb(132, 132, 132);">&nbsp;</div>\r\n\r\n<div class="item_desc_text line" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 18px; vertical-align: baseline; word-spacing: 2px; overflow: hidden; color: rgb(102, 102, 102);">\r\n<div style="margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; float: right;">&nbsp;</div>\r\n\r\n<p><em>Revolution 2020 is an engaging tale of two best friends who fall in love with the same girl. The novel is set against the backdrop of rampant corruption, which one friend yields to, but the other fights.</em></p>\r\n\r\n<p><strong>Summary Of The Book</strong></p>\r\n\r\n<p>The novel is set in Varanasi. Chetan Bhagat initiates the story through the central character Gopal. It is through Gopal&rsquo;s narration of his life to the author that we are introduced to Raghav and Aarti. The story revolves around these three characters. While Gopal comes from a poor family, Raghav comes from a well-off family. Both set out to achieve success and realise their dreams. While Gopal&rsquo;s main motive is to seek financial wealth, Raghav has always wanted to bring in a revolutionary change in the political arena of the country.</p>\r\n\r\n<p>As circumstances may have it, both the boys fall in love with the same girl, Aarti. However, Aarti eventually falls for Raghav. The climax of the story reaches its peak when Aarti harbors feelings for Gopal too. Who will she finally choose? In the meantime, Gopal, through unfair means and with the help of a corrupt politician Shukla, starts an engineering college. Raghav goes on to become a successful journalist and begins to use this power to expose Shukla&rsquo;s wrongdoings.</p>\r\n\r\n<p>It is indeed an interesting tale that has been realistically depicted against the background of a real world where corruption looms large. It brings to light the corrupt system of education in India.&nbsp;<em>Revolution 2020</em>&nbsp;was published in 2011 and turned out to be a bestseller.</p>\r\n\r\n<p><strong>About Chetan Bhagat</strong></p>\r\n\r\n<p>Chetan Bhagat is an ex-student of the Indian Institute of Technology, Delhi, and the Indian Institute of Management, Ahmedabad.<br />\r\nChetan Bhagat has many bestselling novels to his credit such as&nbsp;<em>One Night @ The Call Center, 2 States, Five Point Someone&nbsp;</em>and<em>&nbsp;The 3 Mistakes Of My Life.</em>&nbsp;His writing style is simple and informal.</p>\r\n\r\n<p>Chetan Bhagat is an investment banker by profession. Though he is well known as an Indian author, speaker and columnist, he is seen more as India&rsquo;s youth icon. He has also been listed in the category of 100 most influential people in the world by&nbsp;<em>Time magazine</em>. He also writes columns for&nbsp;<em>Dainik Bhaskar</em>&nbsp;and&nbsp;<em>Times of India</em>. Four of his books have been adapted into films. He is presently resides in Mumbai with his wife and two children.</p>\r\n</div>\r\n', ''),
(145, 2, 'Revolution 2020', '', '', '<h3>REVOLUTION 2020 (PAPERBACK) PRICE: RS.89</h3>\r\n\r\n<div class="cls" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 16px; vertical-align: baseline; clear: both; color: rgb(132, 132, 132);">&nbsp;</div>\r\n\r\n<div class="item_desc_text line" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 18px; vertical-align: baseline; word-spacing: 2px; overflow: hidden; color: rgb(102, 102, 102);">\r\n<div style="margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; float: right;">&nbsp;</div>\r\n\r\n<p><em>Revolution 2020 is an engaging tale of two best friends who fall in love with the same girl. The novel is set against the backdrop of rampant corruption, which one friend yields to, but the other fights.</em></p>\r\n\r\n<p><strong>Summary Of The Book</strong></p>\r\n\r\n<p>The novel is set in Varanasi. Chetan Bhagat initiates the story through the central character Gopal. It is through Gopal&rsquo;s narration of his life to the author that we are introduced to Raghav and Aarti. The story revolves around these three characters. While Gopal comes from a poor family, Raghav comes from a well-off family. Both set out to achieve success and realise their dreams. While Gopal&rsquo;s main motive is to seek financial wealth, Raghav has always wanted to bring in a revolutionary change in the political arena of the country.</p>\r\n\r\n<p>As circumstances may have it, both the boys fall in love with the same girl, Aarti. However, Aarti eventually falls for Raghav. The climax of the story reaches its peak when Aarti harbors feelings for Gopal too. Who will she finally choose? In the meantime, Gopal, through unfair means and with the help of a corrupt politician Shukla, starts an engineering college. Raghav goes on to become a successful journalist and begins to use this power to expose Shukla&rsquo;s wrongdoings.</p>\r\n\r\n<p>It is indeed an interesting tale that has been realistically depicted against the background of a real world where corruption looms large. It brings to light the corrupt system of education in India.&nbsp;<em>Revolution 2020</em>&nbsp;was published in 2011 and turned out to be a bestseller.</p>\r\n\r\n<p><strong>About Chetan Bhagat</strong></p>\r\n\r\n<p>Chetan Bhagat is an ex-student of the Indian Institute of Technology, Delhi, and the Indian Institute of Management, Ahmedabad.<br />\r\nChetan Bhagat has many bestselling novels to his credit such as&nbsp;<em>One Night @ The Call Center, 2 States, Five Point Someone&nbsp;</em>and<em>&nbsp;The 3 Mistakes Of My Life.</em>&nbsp;His writing style is simple and informal.</p>\r\n\r\n<p>Chetan Bhagat is an investment banker by profession. Though he is well known as an Indian author, speaker and columnist, he is seen more as India&rsquo;s youth icon. He has also been listed in the category of 100 most influential people in the world by&nbsp;<em>Time magazine</em>. He also writes columns for&nbsp;<em>Dainik Bhaskar</em>&nbsp;and&nbsp;<em>Times of India</em>. Four of his books have been adapted into films. He is presently resides in Mumbai with his wife and two children.</p>\r\n</div>\r\n', ''),
(146, 1, 'Five Point Someone: What Not To Do At IIT 1st Edition', '', 'Five Point Someone: What Not To Do At IIT 1st Edition - Buy Five Point Someone: What Not To Do At IIT 1st Edition by bhagat, chetan|author only for Rs. 91.00', '<h3>FIVE POINT SOMEONE: WHAT NOT TO DO AT IIT 1ST EDITION (PAPERBACK) PRICE: RS.91</h3>\r\n\r\n<div class="cls" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 16px; vertical-align: baseline; clear: both; color: rgb(132, 132, 132);">&nbsp;</div>\r\n\r\n<div class="item_desc_text line" style="margin: 0px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 18px; vertical-align: baseline; word-spacing: 2px; overflow: hidden; color: rgb(102, 102, 102);">\r\n<div style="margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; vertical-align: baseline; float: right;">&nbsp;</div>\r\n\r\n<p dir="ltr"><em>Five Point Someone: What Not To Do At IIT is a book about three friends who mess up their personal and educational life because of the measly five- point something GPAs in their IITs.</em></p>\r\n\r\n<p dir="ltr"><strong>Summary Of The Book</strong></p>\r\n\r\n<p dir="ltr"><em>Five Point Someone: What Not To Do At IIT</em>&nbsp;is Chetan Bhagat&rsquo;s debut novel that presents a dark and humorous perspective on the Indian education system. Set in the premises of IIT, the story revolves around three students who become friends while struggling to keep their place in this highly esteemed institute.The book doesn&rsquo;t tell you the ways to get into IIT or to survive it but it tells you how bad things can be if one doesn&#39;t think straight.</p>\r\n\r\n<p dir="ltr">The book talks about the monotony of the education system even at one of the country&rsquo;s premier engineering institutes. It takes the reader into the lives of these friends as they toil hard to cope with the strong competition at their college. Hari, Alok, and Ryan enter this institute with a dream to beat the competition and come out successful to become the few chosen ones. However, their life becomes a chaos as they mess up their grades that too big time, Hari falls in love with Prof Cherian&rsquo;s daughter, and Alok and Ryan just cannot control bickering with each other.</p>\r\n\r\n<p dir="ltr">Narrated in first person mostly by Hari,<em>&nbsp;Five Point Someone: What Not To Do At IIT</em>&nbsp;is a dark, funny book that has struck a chord in the hearts of millions of readers across the nation as it sheds some light on the dull and tough academic life in the Indian education system. The protagonists have to deal with tough teachers, with the unending exams, and the difficult academic schedule.</p>\r\n\r\n<p dir="ltr">How will these three friends manage to complete their graduation in ruthless world of IIT? Will they manage to survive? Or will they be the victims of failure at the hands of mind-numbing education system? Bhagat reveals that in this funny yet realistic novel.</p>\r\n\r\n<p dir="ltr"><em>Five Point Someone: What Not To Do At IIT</em>&nbsp;has been adapted into movies in Hindi as well as Tamil. 3 Idiots, the Hindi adaptation, has been a huge success. The book has won Bhagat several awards like Indo-American Society&#39;s Society Young Achiever&#39;s Award and The Publisher&#39;s Recognition Award. It has remained on the bestseller list since its launch in 2004.</p>\r\n\r\n<p dir="ltr"><strong>About Chetan Bhagat</strong></p>\r\n\r\n<p dir="ltr">Chetan Bhagat is an award-winning bestselling Indian author, speaker, and columnist.</p>\r\n\r\n<p dir="ltr">Bhagat has also published other novels including&nbsp;<em>2 States, What Young India Wants, The 3 Mistakes Of My Life, Revolution 2020, and One Night @ The Call Center.</em></p>\r\n\r\n<p>Born on 22nd April 1974, Bhagat attended IIT Delhi and later did his MBA from IIM. He started his career as an investment banker in Hong Kong but in 2009 left his lucrative job to devote his full time to writing. Besides writing novels, he also writes columns for leading English as well as Hindi newspapers like The Times Of India and Dainik Bhaskar. He was named among the 100 Most Influential People in the World by Time magazine. Today he is seen as a youth icon in India. Four of his movies have been adapted to movies. He was awarded Society Young Achiever&rsquo;s Award and Publisher&rsquo;s Recognition Award in 2004 and 2005 respectively.</p>\r\n</div>\r\n', ''),
