(149, 1, 'Samsung Galaxy Note 3 N9000', 'Full HD Screen, Direct Pen Input, Air Command, GB RAM, Dual Video Call, BSI Sensor, NFC Support, NFC Support', 'Samsung Galaxy Note 3 N9000 Price, Samsung Galaxy Note 3 N9000 Specs, Samsung Galaxy Note 3 N9000 Features', '<h3><strong>Key Features</strong></h3>\r\n\r\n<div class="line bmargin10" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 18px; vertical-align: baseline; overflow: hidden; color: rgb(102, 102, 102); word-spacing: 2px;">\r\n<ul>\r\n	<li><span style="font-family:inherit; font-size:inherit">Octa Core Processor (1.9 GHz Quad + 1.3 GHz Quad) and 3 GB RAM</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Dual Camera: Dual Shot / Dual Recording / Dual Video Call</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">13 MP Primary Camera with Auto Focus and BSI Sensor</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">2 MP Secondary Camera with Smart Stabilization and BSI Sensor</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">S Pen Optimized Features: Air Command; Action Memo; Scrapbook; S Finder; Pen Window; Multi Window; Direct Pen Input</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">NFC Support</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Android v4.3 (Jelly Bean) OS</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Full HD (1080p) Recording and Playback Support</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">5.7-inch Full HD Super AMOLED (1920 x 1080) Display</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Samsung Smart Scroll and Samsung Smart Pause</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Air Gesture and Air View</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p>Taking the mundane into the realms of the outstanding, Samsung presents the Galaxy Note 3 N9000, a revolution in technology set in the palm of the hand. Working towards making everyday living a pleasurable experience, the Note 3 will change the way you function.</p>\r\n\r\n<p><strong>Air Command</strong></p>\r\n\r\n<p>Simplicity with extreme convenience takes precedence in the Note 3 that lets you play with a palette that brings five useful S Pen features to you in a platter. Simply hover the S Pen over the screen and click the pen button to access - Action Memo to activate memos, a Scrapbook to organize pieces of your life, the S Finder for quick access to anything on the phone or web, a Pen Window to draw on that helps perform another simple task and Screen Write to make quick annotations.</p>\r\n\r\n<p><strong>S Note and Easy Clip</strong></p>\r\n\r\n<p>While the S Note helps you compose and manage your thoughts in a quick and easy manner on extensive canvases that you can edit and share easily, the Easy Clip allows you to crop out images easily, automatically.</p>\r\n\r\n<p><strong>Direct Pen Input</strong></p>\r\n\r\n<p>Use the S Pen to write on the screen on the Note 3 which is programmed to recognize both your handwriting and typing. If you &lsquo;call Mom&rsquo; on the screen, the phone will proceed to interpret the message and call your mother.</p>\r\n\r\n<p><strong>Multi Window</strong></p>\r\n\r\n<p>Taking multitasking to a whole new level, the Multi-Window mode on the Note 3 allows you to not just copy and paste from one window to another but also do things like chat with two different people at the same time, play a video while scrolling through the news and even browse the net while checking Facebook on the side.</p>\r\n\r\n<p><strong>Full HD Screen</strong></p>\r\n\r\n<p>A quick peek just does not do justice to the 5.7 inch full HD Super AMOLED screen on the Note 3 that keeps your eyes hooked, making it so much easier to see what you are doing and upgrading everything that you do to full HD resolution.</p>\r\n', ''),
(149, 2, 'Samsung Galaxy Note 3 N9000', 'Full HD Screen, Direct Pen Input, Air Command, GB RAM, Dual Video Call, BSI Sensor, NFC Support, NFC Support', 'Samsung Galaxy Note 3 N9000 Price, Samsung Galaxy Note 3 N9000 Specs, Samsung Galaxy Note 3 N9000 Features', '<h3><strong>Key Features</strong></h3>\r\n\r\n<div class="line bmargin10" style="margin: 0px 0px 10px; padding: 0px; border: 0px; font-family: arial, tahoma, verdana, sans-serif; line-height: 18px; vertical-align: baseline; overflow: hidden; color: rgb(102, 102, 102); word-spacing: 2px;">\r\n<ul>\r\n	<li><span style="font-family:inherit; font-size:inherit">Octa Core Processor (1.9 GHz Quad + 1.3 GHz Quad) and 3 GB RAM</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Dual Camera: Dual Shot / Dual Recording / Dual Video Call</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">13 MP Primary Camera with Auto Focus and BSI Sensor</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">2 MP Secondary Camera with Smart Stabilization and BSI Sensor</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">S Pen Optimized Features: Air Command; Action Memo; Scrapbook; S Finder; Pen Window; Multi Window; Direct Pen Input</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">NFC Support</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Android v4.3 (Jelly Bean) OS</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Full HD (1080p) Recording and Playback Support</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">5.7-inch Full HD Super AMOLED (1920 x 1080) Display</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Samsung Smart Scroll and Samsung Smart Pause</span></li>\r\n	<li><span style="font-family:inherit; font-size:inherit">Air Gesture and Air View</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p>Taking the mundane into the realms of the outstanding, Samsung presents the Galaxy Note 3 N9000, a revolution in technology set in the palm of the hand. Working towards making everyday living a pleasurable experience, the Note 3 will change the way you function.</p>\r\n\r\n<p><strong>Air Command</strong></p>\r\n\r\n<p>Simplicity with extreme convenience takes precedence in the Note 3 that lets you play with a palette that brings five useful S Pen features to you in a platter. Simply hover the S Pen over the screen and click the pen button to access - Action Memo to activate memos, a Scrapbook to organize pieces of your life, the S Finder for quick access to anything on the phone or web, a Pen Window to draw on that helps perform another simple task and Screen Write to make quick annotations.</p>\r\n\r\n<p><strong>S Note and Easy Clip</strong></p>\r\n\r\n<p>While the S Note helps you compose and manage your thoughts in a quick and easy manner on extensive canvases that you can edit and share easily, the Easy Clip allows you to crop out images easily, automatically.</p>\r\n\r\n<p><strong>Direct Pen Input</strong></p>\r\n\r\n<p>Use the S Pen to write on the screen on the Note 3 which is programmed to recognize both your handwriting and typing. If you &lsquo;call Mom&rsquo; on the screen, the phone will proceed to interpret the message and call your mother.</p>\r\n\r\n<p><strong>Multi Window</strong></p>\r\n\r\n<p>Taking multitasking to a whole new level, the Multi-Window mode on the Note 3 allows you to not just copy and paste from one window to another but also do things like chat with two different people at the same time, play a video while scrolling through the news and even browse the net while checking Facebook on the side.</p>\r\n\r\n<p><strong>Full HD Screen</strong></p>\r\n\r\n<p>A quick peek just does not do justice to the 5.7 inch full HD Super AMOLED screen on the Note 3 that keeps your eyes hooked, making it so much easier to see what you are doing and upgrading everything that you do to full HD resol