(155, 1, ' EAGLE USA MENS TEE', ' A classic crew neck tee in army green is highlighted by an eagle emblem on the front for a nod to time-honored, American military style. In order to encapsulate a signature vintage effect, a ', ' A classic crew neck tee in army green is highlighted by an eagle emblem on the front for a nod to time-honored, American military style. In order to encapsulate a signature vintage effect, a thorough handcrafted wash was applied. An added bonus is the superbly soft hand that comes with our natural distress process.', '', ''),
