(156, 1, 'RATTLE INDIGO MENS TEE', 'RATTLE INDIGO MENS TEE', 'Adding to our array of hand illustrated tees is the Rattle Indigo shirt in Indigo Blue. This classic crew neck features an original rattlesnake logo created by our in-house design team. The idea was to bring our western roots and passion for denim into a single tee that we envision being worn with our premium jeans. The material is equally as impressive as the artwork with a vintage hand that feels almost like a second skin.', '', ''),
(156, 2, 'RATTLE INDIGO MENS TEE', 'RATTLE INDIGO MENS TEE', 'Adding to our array of hand illustrated tees is the Rattle Indigo shirt in Indigo Blue. This classic crew neck features an original rattlesnake logo created by our in-house design team. The idea was to bring our western roots and passion for denim into a single tee that we envision being worn with our premium jeans. The material is equally as impressive as the artwork with a vintage hand that feels almost like a second skin.', '', ''),
(157, 1, 'DOLCIS Sequinned Bow Court Shoes', 'DOLCIS Sequinned Bow Court Shoes', 'DOLCIS Sequinned Bow Court Shoes', '<h5 style="text-align:start">ABOUT DOLCIS COLLECTION</h5>\r\n\r\n<p style="text-align:start">Ladylike styles and a punk theme come together as the UK based shoe label puts together the perfect edit of occasion&nbsp;footwear. Step up your game with the military numbers, the season&rsquo;s studs and party perfect heels from this cool new line.</p>\r\n', ''),
