(159, 1, 'Franco Leone Men Black Leather Formal Shoes', 'Franco Leone', 'Franco Leone', '<h5><u>Product Details</u></h5>\r\n\r\n<div class="description">\r\n<ul>\r\n	<li>Tapered square toed, black formal shoes with slip-on and low top styling</li>\r\n	<li>Leather upper with stitched and overlay detail</li>\r\n	<li>Elasticated inserts near the mouth</li>\r\n	<li>Reinforced overlay at the heel collar</li>\r\n	<li>Soft and padded footbed with branding</li>\r\n	<li>Tough and textured outsole with a stack heel</li>\r\n	<li>Warranty: 3 months</li>\r\n</ul>\r\n</div>\r\n\r\n<h5><u>Material &amp; Care</u></h5>\r\n\r\n<ul>\r\n	<li>Leather</li>\r\n	<li>Wipe with a clean, dry cloth when needed</li>\r\n</ul>\r\n', ''),
(159, 2, 'Franco Leone Men Black Leather Formal Shoes', 'Franco Leone', 'Franco Leone', '<h3><u>Product Details</u></h3>\r\n\r\n<div class="description">\r\n<ul>\r\n	<li>Tapered square toed, black formal shoes with slip-on and low top styling</li>\r\n	<li>Leather upper with stitched and overlay detail</li>\r\n	<li>Elasticated inserts near the mouth</li>\r\n	<li>Reinforced overlay at the heel collar</li>\r\n	<li>Soft and padded footbed with branding</li>\r\n	<li>Tough and textured outsole with a stack heel</li>\r\n	<li>Warranty: 3 months</li>\r\n</ul>\r\n</div>\r\n\r\n<h3><u>Material &amp; Care</u></h3>\r\n\r\n<ul>\r\n	<li>Leather</li>\r\n	<li>Wipe with a clean, dry cloth when needed</li>\r\n</ul>\r\n', ''),
(160, 1, ' Aetrex Men''s Rhino Runner  ', 'Aetrex Men''s Rhino', 'Aetrex Men''s Rhino', '<h3><u>Product Info </u></h3>\r\n\r\n<p>Achieve full speed in the high performance Aetrex Rhino Runners, built for exceptional stability and shock attenuation.</p>\r\n\r\n<ul>\r\n	<li>OH2 Flo mesh upper</li>\r\n	<li>Contrex(TM) external stability enhancer</li>\r\n	<li>Carboplast(R) Footbridge for stability</li>\r\n	<li>Removable Mozaic pressure relief insole</li>\r\n	<li>Tri-density compression sculpted midsole</li>\r\n	<li>Ultra abrasion resistant heel plug</li>\r\n	<li>Superior slip-resistant, deep-channeled outsole</li>\r\n</ul>\r\n', ''),
