(161, 1, 'Reebok Trans Sport LP Black Running Shoes', 'Reebok Trans Sport LP', 'Reebok Trans Sport LP', '<h4>Description of Reebok Trans Sport LP Black Running Shoes</h4>\r\n\r\n<div class="details-content">\r\n<p>Established by Joseph William Foster in 1890, Reebok is a world class sports equipment manufacturing company. Reebok is known to produce comfortable and scientific sportswear which provides superior performance. The brand has products ranging from footwear, apparels, accessories and equipment&#39;s for men, women and young adults which help them to reach their full athletic potential efficiently.</p>\r\n</div>\r\n', ''),
(161, 2, 'Reebok Trans Sport LP Black Running Shoes', 'Reebok Trans Sport LP', 'Reebok Trans Sport LP', '<h4>Description of Reebok Trans Sport LP Black Running Shoes</h4>\r\n\r\n<div class="details-content">\r\n<p>Established by Joseph William Foster in 1890, Reebok is a world class sports equipment manufacturing company. Reebok is known to produce comfortable and scientific sportswear which provides superior performance. The brand has products ranging from footwear, apparels, accessories and equipment&#39;s for men, women and young adults which help them to reach their full athletic potential efficiently.</p>\r\n</div>\r\n', ''),
