(163, 1, 'Cubic Zircon Mangalsutra by Spargz', 'Spargz', 'Spargz', '<p>A splendid mangalsutra set from Spargz for those special days when you want to look your best. Crafted artistically with brass and gold plated to give it a rich and classy look. Shimmering cubic zircons bring out the dazzler in this mangalsutra that comes with a pair of matching earrings. Pair it with matching bangles and complete your look.</p>\r\n', '');
