(163, 2, 'Cubic Zircon Mangalsutra by Spargz', 'Spargz', 'Spargz', '<p>A splendid mangalsutra set from Spargz for those special days when you want to look your best. Crafted artistically with brass and gold plated to give it a rich and classy look. Shimmering cubic zircons bring out the dazzler in this mangalsutra that comes with a pair of matching earrings. Pair it with matching bangles and complete your look.</p>\r\n', ''),
(164, 1, 'Gold Bangle With Stones 22Kt Size', '', '', '<div class="product-code">Code: 39775&nbsp;</div>\r\n\r\n<div class="product-weight">Weight: 41.40 Gms.</div>\r\n\r\n<div class="custom-field" id="customfields-color">Color: Antique</div>\r\n\r\n<div class="custom-field" id="customfields-gender">Gender: Female</div>\r\n\r\n<div class="custom-field" id="customfields-agegroup">age group: Adult</div>\r\n\r\n<p>22karat gold bangle with stones, light antique finish, oval shape, hinge opening, inner diameter of the bangle is 2.4/16th inches ( 57.0 mm ) all round width is 10.0 mm ( 0.4 inch ) front face width is 24.0 mm ( 0. 96 inch )</p>\r\n', ''),
(164, 2, 'Gold Bangle With Stones 22Kt Size', '', '', '<div class="product-code">Code: 39775&nbsp;</div>\r\n\r\n<div class="product-weight">Weight: 41.40 Gms.</div>\r\n\r\n<div class="custom-field" id="customfields-color">Color: Antique</div>\r\n\r\n<div class="custom-field" id="customfields-gender">Gender: Female</div>\r\n\r\n<div class="custom-field" id="customfields-agegroup">age group: Adult</div>\r\n\r\n<p>22karat gold bangle with stones, light antique finish, oval shape, hinge opening, inner diameter of the bangle is 2.4/16th inches ( 57.0 mm ) all round width is 10.0 mm ( 0.4 inch ) front face width is 24.0 mm ( 0. 96 inch )</p>\r\n', ''),
(165, 1, 'Sony DSC-RX100M II Cyber-shot 20.2MP Point-and-Shoot Digital Cam', 'Cyber-shot 20.2MP', 'Cyber-shot 20.2MP', '<p>Extremely high sensitivity and remarkably low noise are achieved thanks to Sony&rsquo;s massive new 20.2-megapixel. Exmor RCMOS sensor. Its back illumination technology collects light more efficiently and combines with image processing advances to dramatically reduce noise, so you can shoot amazingly clean, low-noise photos and movies in dimly-lit environments at high-sensitivity settings.</p>\r\n', ''),
(165, 2, 'Sony DSC-RX100M II Cyber-shot 20.2MP Point-and-Shoot Digital Cam', 'Cyber-shot 20.2MP', 'Cyber-shot 20.2MP', '<p>Extremely high sensitivity and remarkably low noise are achieved thanks to Sony&rsquo;s massive new 20.2-megapixel. Exmor RCMOS sensor. Its back illumination technology collects light more efficiently and combines with image processing advances to dramatically reduce noise, so you can shoot amazingly clean, low-noise photos and movies in dimly-lit environments at high-sensitivity settings.</p>\r\n', ''),
(166, 1, 'Panasonic Lumix DMC-FZ200 12.1 MP Point & Shoot Digital Camera ', 'Lumix DMC-FZ200 12.1', 'Lumix DMC-FZ200 12.1', '<h3>Description of Panasonic Lumix DMC-FZ200 12.1 MP Point &amp; Shoot Digital Camera (Black)</h3>\r\n\r\n<div>\r\n<p>The latest entry in the Panasonic Lumix series is DMC-FZ200. With 12.1 megapixels, 24X super zoom, a remarkable constant-F2.8 lens and a high-resolution electronic viewfinder, this camera promises high performance. Thanks to its fast lens, you can easily take high-quality shots at full zoom without bothering about ISO settings. The camera features a 1.3m dot equivalent electronic viewfinder. It has been engineered to take 12 frames per second and record 1080p video at 60fps or 720p at up to 120fps.</p>\r\n\r\n<p><strong>25-600 mm Lens with Full-Range F2.8 Aperture</strong></p>\r\n\r\n<p>Lumix DMC-FZ200 is equipped with a high-quality LEICA DC VARIO-ELMARIT 25mm ultra wide-angle lens with a 24x optical zoom (35mm camera equivalent: 25-600mm). The bright F2.8 aperture allows you to shoot a distant moving subject at fast shutter speed.</p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/fullrange_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Coatingimage11.jpg" style="height:272px; width:363px" /></p>\r\n\r\n<p>The lens unit of DMC-FZ200 consists of 14 elements in 11 groups, including 3 ED lenses and 5 aspherical lenses with 9 aspherical surfaces. This gives the camera a compact design apart from enhancing its optical performance.</p>\r\n\r\n<p><strong>Side lever for convenient operation</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/sidelever_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Lensimage12.jpg" style="height:160px; width:240px" /></p>\r\n\r\n<p>The camera is equipped with a side lever on the left side of lens barrel. This makes it easy to zoom with the left hand while working on the shutter operation with the right. This feature also comes in handy when you want to change the focus while video recording.</p>\r\n\r\n<p><strong>Nano Surface Coating</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/ns_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_dotimage24.jpg" style="height:153px; width:372px" /></p>\r\n\r\n<p>Lumix DMC-FZ200 boasts of Panasonic&#39;s black box technology. The Nano Surface Coating has an extremely low reflectance ratio and renders spectacular clarity by minimizing flaring and ghosts.</p>\r\n\r\n<p><strong>25-mm Ultra Wide-angle Lens</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/wa_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Resolution15image14.jpg" style="height:272px; width:363px" /></p>\r\n\r\n<p>The 25mm ultra wide-angle lens of DMC-FZ200 offers about twice the shooting area as compared to a standard 35mm lens. This feature helps you to take group shots at an indoor party or shoot a large structure or a sweeping landscape while traveling.</p>\r\n</div>\r\n', ''),
(166, 2, 'Panasonic Lumix DMC-FZ200 12.1 MP Point & Shoot Digital Camera (', 'Lumix DMC-FZ200 12.1', 'Lumix DMC-FZ200 12.1', '<h3>Description of Panasonic Lumix DMC-FZ200 12.1 MP Point &amp; Shoot Digital Camera (Black)</h3>\r\n\r\n<div>\r\n<p>The latest entry in the Panasonic Lumix series is DMC-FZ200. With 12.1 megapixels, 24X super zoom, a remarkable constant-F2.8 lens and a high-resolution electronic viewfinder, this camera promises high performance. Thanks to its fast lens, you can easily take high-quality shots at full zoom without bothering about ISO settings. The camera features a 1.3m dot equivalent electronic viewfinder. It has been engineered to take 12 frames per second and record 1080p video at 60fps or 720p at up to 120fps.</p>\r\n\r\n<p><strong>25-600 mm Lens with Full-Range F2.8 Aperture</strong></p>\r\n\r\n<p>Lumix DMC-FZ200 is equipped with a high-quality LEICA DC VARIO-ELMARIT 25mm ultra wide-angle lens with a 24x optical zoom (35mm camera equivalent: 25-600mm). The bright F2.8 aperture allows you to shoot a distant moving subject at fast shutter speed.</p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/fullrange_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Coatingimage11.jpg" style="height:272px; width:363px" /></p>\r\n\r\n<p>The lens unit of DMC-FZ200 consists of 14 elements in 11 groups, including 3 ED lenses and 5 aspherical lenses with 9 aspherical surfaces. This gives the camera a compact design apart from enhancing its optical performance.</p>\r\n\r\n<p><strong>Side lever for convenient operation</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/sidelever_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Lensimage12.jpg" style="height:160px; width:240px" /></p>\r\n\r\n<p>The camera is equipped with a side lever on the left side of lens barrel. This makes it easy to zoom with the left hand while working on the shutter operation with the right. This feature also comes in handy when you want to change the focus while video recording.</p>\r\n\r\n<p><strong>Nano Surface Coating</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/ns_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_dotimage24.jpg" style="height:153px; width:372px" /></p>\r\n\r\n<p>Lumix DMC-FZ200 boasts of Panasonic&#39;s black box technology. The Nano Surface Coating has an extremely low reflectance ratio and renders spectacular clarity by minimizing flaring and ghosts.</p>\r\n\r\n<p><strong>25-mm Ultra Wide-angle Lens</strong></p>\r\n\r\n<p><img alt="Description: http://panasonic.net/avc/lumix/compact/fz200/img/lens/wa_img01.jpg" src="http://i.sdlcdn.com/img/product/panasonic_Resolution15image14.jpg" style="height:272px; width:363px" /></p>\r\n\r\n<p>The 25mm ultra wide-angle lens of DMC-FZ200 offers about twice the shooting area as compared to a standard 35mm lens. This feature helps you to take group shots at an indoor party or shoot a large structure or a sweeping landscape while traveling.</p>\r\n</div>\r\n', ''),
(167, 1, 'Canon PowerShot A2500 16MP Point & Shoot Digital Camera (Silver)', 'Canon PowerShot A2500 16MP', 'Canon PowerShot A2500 16MP', '<h4>Description of Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver)</h4>\r\n\r\n<div>\r\n<p>Get the perfect tool to capture those cherished memories with the Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver). The camera is packed to the hilt with unique and innovative features which ensures best-in-class imaging in a smart and trendy package. It utilizes highly advanced imaging technology, allowing you to capture perfect still images coupled with sharp HD Videos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://i.sdlcdn.com/img/product/descimg/JO_Cnn_Ps_A2500_Blk_1.jpg" /></p>\r\n\r\n<p><strong><u>16.0 Megapixel Sensor</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Black) features a&nbsp;<strong>16 Megapixel Sensor</strong>&nbsp;at its core, allowing you to capture image which are rich and clear, with textures and tiny details brilliantly captured. The high level of resolution is ideal for creating large prints, giving you unmatched flexibility to enlarge or crop any section of an image to enhance your creativity.</p>\r\n\r\n<p><strong><u>DIGIC 4 Image Processor</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver) features&nbsp;<strong>DIGIC 4 Image Processor,</strong>&nbsp;which has set the standards for functionality and performance since their ground-breaking introduction. The DIGIC 4 Image Processor brings you a new level of image quality and accelerated processing, allowing you to take high speed continuous shots, HD Video as well as performing complex computational tasks such as Face Detection Self Timer instantaneously</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://i.sdlcdn.com/img/product/descimg/JO_Cnn_Ps_A2500_Blk_2.jpg" /></p>\r\n\r\n<p><strong><u>5x Wide Angle Zoom with 28mm Wide Angle Lens</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver) features an inbuilt&nbsp;<strong>5x Optical Zoom</strong>&nbsp;(35mm Equivalent: 28mm to 140mm), providing you with outstanding optical performance and versatility. It provides you with a great range of shots from a single location. The lens is perfect for sporting events and other occasions when the shooting stance is fixed. It can also be brilliantly used for photos where close movement causes disturbance to the subject or action. The&nbsp;<strong>28mm Wide Angle Lens</strong>&nbsp;puts more imaging in every frame for dynamic and exciting shots.</p>\r\n</div>\r\n', ''),
(167, 2, 'Canon PowerShot A2500 16MP Point & Shoot Digital Camera (Silver)', 'Canon PowerShot A2500 16MP', 'Canon PowerShot A2500 16MP', '<h3>Description of Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver)</h3>\r\n\r\n<div>\r\n<p>Get the perfect tool to capture those cherished memories with the Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver). The camera is packed to the hilt with unique and innovative features which ensures best-in-class imaging in a smart and trendy package. It utilizes highly advanced imaging technology, allowing you to capture perfect still images coupled with sharp HD Videos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://i.sdlcdn.com/img/product/descimg/JO_Cnn_Ps_A2500_Blk_1.jpg" /></p>\r\n\r\n<p><strong><u>16.0 Megapixel Sensor</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Black) features a&nbsp;<strong>16 Megapixel Sensor</strong>&nbsp;at its core, allowing you to capture image which are rich and clear, with textures and tiny details brilliantly captured. The high level of resolution is ideal for creating large prints, giving you unmatched flexibility to enlarge or crop any section of an image to enhance your creativity.</p>\r\n\r\n<p><strong><u>DIGIC 4 Image Processor</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver) features&nbsp;<strong>DIGIC 4 Image Processor,</strong>&nbsp;which has set the standards for functionality and performance since their ground-breaking introduction. The DIGIC 4 Image Processor brings you a new level of image quality and accelerated processing, allowing you to take high speed continuous shots, HD Video as well as performing complex computational tasks such as Face Detection Self Timer instantaneously</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://i.sdlcdn.com/img/product/descimg/JO_Cnn_Ps_A2500_Blk_2.jpg" /></p>\r\n\r\n<p><strong><u>5x Wide Angle Zoom with 28mm Wide Angle Lens</u></strong></p>\r\n\r\n<p>The Canon PowerShot A2500 16MP Point &amp; Shoot Digital Camera (Silver) features an inbuilt&nbsp;<strong>5x Optical Zoom</strong>&nbsp;(35mm Equivalent: 28mm to 140mm), providing you with outstanding optical performance and versatility. It provides you with a great range of shots from a single location. The lens is perfect for sporting events and other occasions when the shooting stance is fixed. It can also be brilliantly used for photos where close movement causes disturbance to the subject or action. The&nbsp;<strong>28mm Wide Angle Lens</strong>&nbsp;puts more imaging in every frame for dynamic and exciting shots.</p>\r\n</div>\r\n', ''),
(168, 1, 'Nikon Coolpix L830 Digital Camera - Plum', '', '', '<h3>Product Details of <strong>Nikon Coolpix L830 Digital Camera - Plum</strong></h3>\r\n\r\n<h3>Key Features</h3>\r\n\r\n<ul>\r\n	<li>16MP BSI-CMOS sensor</li>\r\n	<li>34x optical and 4x digital zoom</li>\r\n	<li>3-inches LCD monitor</li>\r\n	<li>5-Axis Hybrid Vibration Reduction</li>\r\n	<li>Full HD movie recording</li>\r\n	<li>ISO 125-3200 sensitivity range</li>\r\n</ul>\r\n\r\n<p>An ultra-high-power zoom bridge digital compact camera from the house of Nikon! In its L-series digital compact cameras, Nikon has newly introduced <strong>COOLPIX L830 digital camera</strong>, which lets you capture exceptional quality images in sheer style. It comes with 16MP BSI-CMOS sensor and NIKKOR lens with 36x optical zoom to capture far-away subjects in superb clarity. The zoom lens offers 22.5 - 765mm of focal length to cover wide range of area. Also, the lens supports 68x Dynamic Fine Zoom, which enables macro shooting as close as approx. 1cm.</p>\r\n\r\n<p><strong>Sensor and Processor</strong></p>\r\n\r\n<p>The camera comes with 16MP BSI-CMOS image sensor, which helps you to shoot natural-looking, crisp images at different occasions, be it party, family get-together, wedding, concerts or anything. Besides this, this image sensor also performs exceptionally well in low-light situations; even you can shoot and capture images and videos without using flash (depend upon the conditions). The internal system of the camera runs with speed and efficiency with support to Nikon&#39;s EXPEED C2 image processing engine. So, now you can create beautiful pictures and movies with ease and in vibrant colours.</p>\r\n\r\n<p><strong>Full HD Video Recording</strong></p>\r\n\r\n<p>Now, you can shoot beautiful full HD movies in 1920 x 1080p resolution with this COOLPIX camera. The camera comes with intelligent 5-Axis Hybrid Vibration Reduction function to let you shoot videos with stable images, even while walking and talking with the subject or recording panorama from a moving vehicle. This VR features helps in effectively reducing different types of camera shake.</p>\r\n\r\n<p><strong>LCD monitor</strong></p>\r\n\r\n<p>The camera is equipped with 3-inches LCD screen, which is appropriate for composing, viewing and sharing photos and HD videos. This VGA display supports 921k dots resolution and has wide viewing angle. The screen has anti-reflection coating and comes with 6-levels of brightness adjustment function.</p>\r\n\r\n<p><strong>Other Features</strong></p>\r\n\r\n<p>The camera offers ISO 125-3200 of sensitivity range, and comes with various shooting modes. Also, it comes with special effects and filter effects to make your images look more eye-catchy.</p>\r\n', ''),
(168, 2, 'Nikon Coolpix L830 Digital Camera - Plum', '', '', '<h3>Product Details of <strong>Nikon Coolpix L830 Digital Camera - Plum</strong></h3>\r\n\r\n<h3>Key Features</h3>\r\n\r\n<ul>\r\n	<li>16MP BSI-CMOS sensor</li>\r\n	<li>34x optical and 4x digital zoom</li>\r\n	<li>3-inches LCD monitor</li>\r\n	<li>5-Axis Hybrid Vibration Reduction</li>\r\n	<li>Full HD movie recording</li>\r\n	<li>ISO 125-3200 sensitivity range</li>\r\n</ul>\r\n\r\n<p>An ultra-high-power zoom bridge digital compact camera from the house of Nikon! In its L-series digital compact cameras, Nikon has newly introduced <strong>COOLPIX L830 digital camera</strong>, which lets you capture exceptional quality images in sheer style. It comes with 16MP BSI-CMOS sensor and NIKKOR lens with 36x optical zoom to capture far-away subjects in superb clarity. The zoom lens offers 22.5 - 765mm of focal length to cover wide range of area. Also, the lens supports 68x Dynamic Fine Zoom, which enables macro shooting as close as approx. 1cm.</p>\r\n\r\n<p><strong>Sensor and Processor</strong></p>\r\n\r\n<p>The camera comes with 16MP BSI-CMOS image sensor, which helps you to shoot natural-looking, crisp images at different occasions, be it party, family get-together, wedding, concerts or anything. Besides this, this image sensor also performs exceptionally well in low-light situations; even you can shoot and capture images and videos without using flash (depend upon the conditions). The internal system of the camera runs with speed and efficiency with support to Nikon&#39;s EXPEED C2 image processing engine. So, now you can create beautiful pictures and movies with ease and in vibrant colours.</p>\r\n\r\n<p><strong>Full HD Video Recording</strong></p>\r\n\r\n<p>Now, you can shoot beautiful full HD movies in 1920 x 1080p resolution with this COOLPIX camera. The camera comes with intelligent 5-Axis Hybrid Vibration Reduction function to let you shoot videos with stable images, even while walking and talking with the subject or recording panorama from a moving vehicle. This VR features helps in effectively reducing different types of camera shake.</p>\r\n\r\n<p><strong>LCD monitor</strong></p>\r\n\r\n<p>The camera is equipped with 3-inches LCD screen, which is appropriate for composing, viewing and sharing photos and HD videos. This VGA display supports 921k dots resolution and has wide viewing angle. The screen has anti-reflection coating and comes with 6-levels of brightness adjustment function.</p>\r\n\r\n<p><strong>Other Features</strong></p>\r\n\r\n<p>The camera offers ISO 125-3200 of sensitivity range, and comes with various shooting modes. Also, it comes with special effects and filter effects to make your images look more eye-catchy.</p>\r\n', ''),
(169, 1, 'Fujifilm Finepix X100S Digital Camera', '', '', '<p>FUJIFILM X100S, the successor to the FUJIFILM X100, inherits the X100&#39;s elegant design and high-performance lens, while evolving further to meet customer&#39;s demands with the introduction of a higher-definition Hybrid Viewfinder and a new sensor and processor.</p>\r\n', ''),
